import React from "react";
import articleConent from "./article-content.js";

function Articles() {
  return (
    <div>
      <h1>Articles</h1>
      {articleConent.map(article => (
        <div key={article.id}>
          <h2>{article.title}</h2>
        </div>
      ))}
    </div>
  );
}

export default Articles;
